const MAX_EXECUTION_TIME_MS = 40000; 
const MAX_INPUT_LENGTH = 300000;
const MAX_OUTPUT_ITEMS = 50;

const startTime = Date.now();
const out = [];

function checkLimits() {
  if (Date.now() - startTime > MAX_EXECUTION_TIME_MS) return true;
  if (out.length >= MAX_OUTPUT_ITEMS) return true;
  return false;
}

// Sicheres Chunking
function chunkStringSafe(str, size = 1500) {
  if (!str) return [];
  const chunks = [];
  let i = 0;
  let safety = 0;
  while (i < str.length) {
    if (safety++ > 1000) break;
    let end = Math.min(i + size, str.length);
    // Versuchen, an einem Satzende zu schneiden (Punkt), wenn möglich
    const lastDot = str.lastIndexOf('.', end);
    if (lastDot > i && lastDot > end - 200) end = lastDot + 1;

    chunks.push(str.slice(i, end).trim());
    i = end; // Kein Overlap nötig, wenn wir sauber schneiden, sonst: i += (size - 200);
  }
  return chunks;
}

// === HAUPT-LOGIK ===
const item = items[0]; 

if (item) {
  try {
    const firecrawlData = item.json.data || {};
    let rawText = (firecrawlData.markdown || "").toString();
    delete item.json.data; // RAM sparen

    // Metadaten holen (vom Loop Node)
    let sheetData = {};
    try { sheetData = $('Loop Over Items1').first().json; } catch(e) { sheetData = item.json; }

    const brand = sheetData.brand || "Unknown"; 
    const category = sheetData.category || "general";
    const sourceUrl = sheetData.url || "unknown_url";
    const pageTitle = firecrawlData.metadata?.title || "Webpage";
    const scrapedAt = new Date().toISOString();

    // Cleaning
    if (rawText.length > MAX_INPUT_LENGTH) rawText = rawText.substring(0, MAX_INPUT_LENGTH);

    if (rawText.length > 50 && !checkLimits()) {
       let text = rawText
         // Link-Müll entfernen (Feedack: "[]() | []()")
         .replace(/\[\s*\]\([^)]+\)\s*(\\|\s*\|\s*)?/g, "") 
         .replace(/!\[.*?\]\(.*?\)/g, "") 
         .replace(/(This site uses|We use) cookies.*?(manage|accept|settings).*?$/gim, "")
         .replace(/UnderstoodManage Settings|Contact us/gi, "")
         .replace(/Skip to content|Toggle navigation|Log in|Sign up/gi, "")
         .replace(/\n{3,}/g, "\n\n");

       rawText = null;

       // Splitting
       const parts = text.split(/(?=^#{1,3}\s)/gm);

       let globalChunkCounter = 0; // Zähler für die Unique ID

       for (const part of parts) {
         if (checkLimits()) break; 
         if (part.length < 50) continue; // Zu kurz -> Weg damit (Quality Gate)

         const headerMatch = part.match(/^(#{1,3})\s+(.*)/);
         const sectionTitle = headerMatch ? headerMatch[2].trim() : "General";
         const body = part.replace(/^(#{1,3})\s+(.*)/, "").trim();

         // Quality Gate: Wenn Body fast leer oder nur Links -> Skip
         if (body.length < 50) continue; 

         const fullContent = `Brand: ${brand}\nCategory: ${category}\nTitle: ${pageTitle}\nSection: ${sectionTitle}\n\n${body}`;
         const chunks = chunkStringSafe(fullContent);

         for (const chunk of chunks) {
            if (checkLimits()) break;

            // UNIQUE ID GENERIEREN (Das ist der Fix für das Feedback!)
            // Wir nutzen die URL + einen Zähler, damit jeder Schnipsel eindeutig ist.
            // .replace entfernt Sonderzeichen aus der URL für saubere IDs
            const safeUrlId = sourceUrl.replace(/[^a-zA-Z0-9]/g, "").substring(0, 50);
            const uniqueId = `${safeUrlId}_${globalChunkCounter}`;

            out.push({
              json: {
                // ID für die Datenbank (Upsert Key)
                id: uniqueId, 

                // Inhalt
                pageContent: chunk,

                // Metadaten
                metadata: {
                  brand: brand,
                  category: category,
                  url: sourceUrl,
                  title: pageTitle,
                  section: sectionTitle,
                  date: scrapedAt,
                  type: "web_scrape"
                }
              }
            });
            globalChunkCounter++;
         }
       }
    }
  } catch (error) {
    console.log("Error:", error.message);
  }
}

return out;

