// Hilfsfunktion: Hype-Punkte basierend auf dem Datum berechnen
function calculateFreshnessScore(dateString) {
  if (!dateString) return 1; // Kein Datum = 1 Punkt (Existiert immerhin)

  const s = dateString.toLowerCase();

  if (s.includes('min') || s.includes('sec')) return 100; // Breaking News!
  if (s.includes('hour')) return 80;  // Sehr frisch
  if (s.includes('day')) return 50;   // Diese Woche
  if (s.includes('week')) return 20;  // Dieser Monat
  if (s.includes('month')) return 5;  // Älter

  // Falls ein festes Datum da steht (z.B. "Nov 12, 2024") -> Eher alt
  return 2; 
}

