  const organicResults = json.organic || [];

  // ALGORITHMUS: Wir summieren die Punkte aller Treffer
  let companyScore = 0;

  organicResults.forEach(result => {
     // Wir analysieren das "date" Feld von Google (z.B. "2 days ago")
     const points = calculateFreshnessScore(result.date);
     companyScore += points;
  });

  // Kleiner Bonus für "Total Results" falls vorhanden (als Basis-Rauschen)
  if (json.searchInformation && json.searchInformation.totalResults) {
     // Wir nehmen die Wurzel, damit SAP nicht mit Millionen Punkten alles sprengt
     // Das glättet die Kurve etwas.
     const cleanTotal = parseInt(json.searchInformation.totalResults.toString().replace(/[^0-9]/g, ''), 10);
